/*Table structure for table `bgm_category` */

DROP TABLE IF EXISTS `bgm_category`;

CREATE TABLE `bgm_category` (
  `id` bigint(128) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `category_id` varchar(128) DEFAULT NULL COMMENT '种类的id',
  `category_name` varchar(128) DEFAULT NULL COMMENT '种类的名称',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8;

