/*Table structure for table `user` */

DROP TABLE IF EXISTS `user`;

CREATE TABLE `user` (
  `id` bigint(128) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `user_id` varchar(128) NOT NULL COMMENT '用户id(唯一)',
  `i_dou_id` varchar(128) NOT NULL COMMENT '用户的爱豆号',
  `nick_name` varchar(128) DEFAULT NULL COMMENT '用户昵称',
  `personal_sign` varchar(128) DEFAULT NULL COMMENT '用户个人签名',
  `school` varchar(128) DEFAULT NULL COMMENT '用户学校',
  `sex` varchar(128) DEFAULT NULL COMMENT '用户性别',
  `birthday` varchar(128) DEFAULT NULL COMMENT '用户生日',
  `region` varchar(128) DEFAULT NULL COMMENT '用户地区',
  `phone_number` varchar(128) DEFAULT NULL COMMENT '手机号',
  `password` varchar(20) DEFAULT NULL COMMENT '密码',
  `portrait` varchar(128) DEFAULT NULL COMMENT '用户头像路径',
  `fans_count` bigint(20) NOT NULL DEFAULT '0' COMMENT '用户的粉丝数量',
  `follow_count` bigint(20) NOT NULL DEFAULT '0' COMMENT '关注的数量',
  `receive_like_count` bigint(20) NOT NULL DEFAULT '0' COMMENT '收到喜欢的数量',
  `background_path` varchar(128) DEFAULT NULL COMMENT '用户的背景图片路径',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='用户表';

