/*Table structure for table `user_fans` */

DROP TABLE IF EXISTS `user_fans`;

CREATE TABLE `user_fans` (
  `id` bigint(128) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `user_id` varchar(128) NOT NULL COMMENT '被关注用户的用户id',
  `fan_user_id` varchar(128) NOT NULL COMMENT '粉丝的用户id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='粉丝/关注关系表';

