/*Table structure for table `user_like_videos` */

DROP TABLE IF EXISTS `user_like_videos`;

CREATE TABLE `user_like_videos` (
  `id` bigint(128) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `user_id` varchar(128) NOT NULL COMMENT '用户id',
  `video_id` varchar(128) NOT NULL COMMENT '视频id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COMMENT='用户喜欢视频的关系表';

