/*Table structure for table `video` */

DROP TABLE IF EXISTS `video`;

CREATE TABLE `video` (
  `id` bigint(128) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `video_id` varchar(128) NOT NULL COMMENT '视频id',
  `publish_user_id` varchar(128) NOT NULL COMMENT '发布者的用户id',
  `bgm_id` varchar(128) DEFAULT 'NULL' COMMENT '背景音乐的id',
  `video_desc` varchar(128) DEFAULT 'NULL' COMMENT '视频的描述',
  `video_path` varchar(128) NOT NULL COMMENT '视频存储的路径',
  `video_seconds` int(128) NOT NULL DEFAULT '0' COMMENT '视频的长度(多少秒)',
  `cover_path` varchar(128) NOT NULL COMMENT '视频的封面路径',
  `like_counts` int(11) NOT NULL DEFAULT '0' COMMENT '视频被多少人喜欢',
  `status` int(11) NOT NULL DEFAULT '0' COMMENT '视频的状态(1:已经上传,待审核,不能播放  2:发布成功,正常播放  3:禁止播放)',
  `create_time` datetime NOT NULL COMMENT '视频的创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='视频表';

